async () => {
		let themes = []; 
		let page = 1; 
		do{
			await list_themes.run({page}); 
			themes = [...themes, ...list_themes.data.results]; 
			page++; 
		}while(list_themes.data.next != null); 
		storeValue('themes', themes); 
	}

